import logo from './logo.svg';
import './App.css';
import headerImg from "./images/extch.png";


function Header() {
  return (
    <>
      <img class='img' src={headerImg} alt="ExTech logo"></img>
      <div>

        <center><h1>Exemplify tech. Job searching. Simplified.</h1></center>
        <center></center>
      </div>
    </>
  );
}

export default Header;
